import React, { Component } from 'react';

class TextInput extends Component {

  constructor(props) {
    super(props)
    this.state = {
      text: ''
    }
  }

  render() {
    return (
      <input placeholder={this.props.placeHolder}></input>
    )
  }
}

export default TextInput;
